import React from 'react';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import api from '../api';

class insertCust extends React.Component{
    constructor(props){
        super(props);
        const { match: { params } } = this.props;
        
        this.state = {
            name: '',
            orgid:params.id,
        }
    }

    render(props) {
        return (
            <React.Fragment>
                <Container component="main" maxWidth="xs">
                    <Typography variant="h6" gutterBottom>
                        Registration
                    </Typography>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField id="company" label="Company" value={this.state.name} onChange={this.handleChangeInputName}/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                            id="contact"
                            label="Contact Name"
                            value={this.state.cname}
                            onChange={this.handleChangeInputRating}
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField required id="Time" label="Time"  autoComplete="cc-exp" 
                            value={time}
                            onChange={this.handleChangeInputTime}/>
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Button variant="outlined" color="primary" onClick={this.handleIncludeMovie}>Save</Button>&nbsp;&nbsp;
                            <Button variant="outlined" color="primary" href={'/movies/list'}>Cancel</Button>
                        </Grid>
                    </Grid>
                    </Container>
            </React.Fragment>
        );
    }
}

export default insertCust;
